import React from 'react';
import { LabelWrapper } from './style';
const Input = props => {
    const {
        type,
        name,
        value,
        placeholder,
        className,
        onChange
    } = props;
    return(
        <React.Fragment>
               <InputWrapper className={className} type={type} name={name} value={value} onChange={onChange} placeholder={placeholder}/>
        </React.Fragment>
    );
}
export default Input;
